    const currentUser = {
        loggedIn: false
    }
    return currentUser && currentUser.loggedIn
}

const PrivateRoutes = () => {
    const useLocation = useLocation();
    const isAuth  = useAuth();

    return isAuth ? ( <Outlet /> 
